import React from "react";
import classes from "./RowTableBooking.module.css";
import { Row, Col } from "react-bootstrap";
import { Button, Badge } from "react-bootstrap";

const RowTableBooking = (props) => {
  return (
    <div className={classes.row}>
      <Row className={classes.row}>
        <Col>
          <Button variant="outline-primary">Show on map</Button>
        </Col>
        <Col>
          <h3>{props.name}</h3>
          <p>{props.city}</p>
          <p>{props.address}</p>
          <a href={props.url}>Link to Booking</a>
        </Col>
        <Col>
          <h3>{props.price}â‚¬</h3>
        </Col>
        <Col>
          <h3>{props.reviewWord}</h3>
          <h1>
            <Badge bg="secondary">{props.review}</Badge>
          </h1>
        </Col>
      </Row>
    </div>
  );
};

export default RowTableBooking;
